eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   projects: () => (/* binding */ projects)\n/* harmony export */ });\nconst projects = [\n    {\n        logo: \"/assets/img/logos/eunomia_logo_light.svg\",\n        route: \"https://eunomia.dit.upm.es/\",\n        title: \"EUNOMIA\",\n        description: \"Eunomia drives a secure data economy in Europe, supporting Gaia-X ISBL and DSBA. EUNOMIA develops open solutions and standards for secure and trusted data sharing. For the Eunomia project, open technical solutions, standards and tools will be developed to enable secure data sharing, guaranteeing the sovereignty and trust of users. The project includes the implementation of FIWARE technologies and other standards to facilitate interoperability and data governance. Tutorials and support will also be provided so that any user can experiment with these technologies.\",\n        description_es: \"Eunomia impulsa una economa de datos segura en Europa, apoyando a Gaia-X ISBL y DSBA. EUNOMIA desarrolla soluciones y estndares abiertos para el intercambio de datos seguro y confiable. Para el proyecto Eunomia, se desarrollarn soluciones tcnicas, estndares y herramientas abiertas para permitir el intercambio seguro de datos, garantizando la soberana y la confianza de los usuarios. El proyecto incluye la implementacin de tecnologas FIWARE y otros estndares para facilitar la interoperabilidad y la gobernanza de datos. Tambin se proporcionarn tutoriales y soporte para que cualquier usuario pueda experimentar con estas tecnologas.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/SMARTY.png\",\n        route: \"https://www.smarty-project.eu/\",\n        title: \"SMARTY\",\n        description: \"SMARTY is a project that creates a secure cloud-edge continuum from heterogeneous systems to safeguard data during transit and processing, providing a reliable foundation for AI processes. It achieves security through quantum-resistant communication, confidential computing, software-defined perimeters, and swarm formation, ensuring multiple layers of protection. The project introduces semantic programmability and graph management for easy, drag-and-drop service deployment. SMARTY is focused on key European sectors such as automotive, fintech, telecommunications, and industrial environments, with technologies tested in five use cases. Supported by large industry players, SMEs, and academic partners, SMARTY aims to mature innovative technologies, fostering collaboration and enhancing Europe's edge computing and AI capabilities across various vertical sectors.\",\n        description_es: \"SMARTY es un proyecto que crea un continuo seguro de nube-borde desde sistemas heterogneos para salvaguardar los datos durante el trnsito y el procesamiento, proporcionando una base fiable para los procesos de IA. Logra la seguridad a travs de la comunicacin resistente a la cuntica, la computacin confidencial, los permetros definidos por software y la formacin de enjambres, garantizando mltiples capas de proteccin. El proyecto introduce la programabilidad semntica y la gestin de grficos para una implementacin de servicios fcil y de arrastrar y soltar. SMARTY se centra en sectores clave europeos como el automotriz, fintech, telecomunicaciones y entornos industriales, con tecnologas probadas en cinco casos de uso. Con el apoyo de grandes actores de la industria, pymes y socios acadmicos, SMARTY tiene como objetivo madurar tecnologas innovadoras, fomentar la colaboracin y mejorar las capacidades de computacin perimetral e IA de Europa en diversos sectores verticales.\",\n        researchLine: [\n            \"ai\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/fun4date.svg\",\n        route: \"https://fun4date.github.io/\",\n        title: \"FuN4DaTe\",\n        description: \"FuN4DaTe, stands for 'Future Networks for Datacenters and Telcos', it is FECYT funded project. FuN4DaTe aims at designing a cost-effective energy-efficient network architecture that approaches the envisioned by the ITU FG-NET2030 network and the Hyperscale cloud providers to upgrade telco networks by boosting bandwidth, latency, security, manynets while incorporating AI/ML into the network operations, on attempts to deal with forthcoming challenging services like holographic-type communications, tactile Internet for remote operations, intelligent operations networks, network and computing convergence, digital twins, space-terrestrial integrated network and industrial IoT with cloudification.\",\n        description_es: \"FuN4DaTe, son las siglas de 'Future Networks for Datacenters and Telcos', es un proyecto financiado por FECYT. FuN4DaTe tiene como objetivo disear una arquitectura de red energticamente eficiente y rentable que se acerque a la visin de la red ITU FG-NET2030 y los proveedores de nube hiperescala para mejorar las redes de telecomunicaciones mediante el aumento del ancho de banda, la latencia, la seguridad, las redes de muchos mientras se incorpora la IA/ML en las operaciones de red, en un intento de hacer frente a servicios desafiantes futuros como las comunicaciones de tipo hologrfico, Internet tctil para operaciones remotas, redes de operaciones inteligentes, convergencia de red y computacin, gemelos digitales, red integrada espacio-terrestre e IIoT con cloudificacin.\",\n        researchLine: [\n            \"computing\",\n            \"ai\",\n            \"data\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/iglue-logo-01.png\",\n        route: \"https://iptc.upm.es/implementation-game-based-learning-using-escape-rooms-proyecto-2024-1-es01-ka220-hed-000256356\",\n        title: \"Implementation of Game-Based Learning using Escape Rooms\",\n        description: \"The project aims to develop a set of escape rooms that will be used as a tool to teach different subjects.\",\n        description_es: \"El proyecto tiene como objetivo desarrollar un conjunto de salas de escape que se utilizarn como herramienta para ensear diferentes materias.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/fiware.png\",\n        route: \"https://www.fiware.org/\",\n        title: \"FIWARE\",\n        description: \"FIWARE brings a curated framework of open source platform components which can be assembled together and with other third-party platform components to build Smart Solutions faster, easier and cheaper. We have participated in several projects related with FIWARE: FICORE, FINEXT and XIFI.\",\n        description_es: \"FIWARE aporta un marco curado de componentes de plataforma de cdigo abierto que se pueden ensamblar juntos y con otros componentes de plataforma de terceros para construir Soluciones Inteligentes ms rpido, ms fcil y ms barato. Hemos participado en varios proyectos relacionados con FIWARE: FICORE, FINEXT y XIFI.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/lynkia.svg\",\n        route: \"http://lynckia.com/\",\n        title: \"Lynckia\",\n        description: \"Lynckia is based on WebRTC technologies. It is 100% compatible with latest stable versions of Google Chrome. Web users will be able to talk from their web browsers with no need to installing anything. Lynckia allows web developers to include videoconference rooms on their web. They can also implement streaming, recording and any other real-time multimedia features!\",\n        description_es: \"Lynckia est basado en tecnologas WebRTC. Es 100% compatible con las ltimas versiones estables de Google Chrome. Los usuarios de la web podrn hablar desde sus navegadores web sin necesidad de instalar nada. Lynckia permite a los desarrolladores web incluir salas de videoconferencia en sus webs. Tambin pueden implementar streaming, grabacin y cualquier otra caracterstica multimedia en tiempo real!\",\n        researchLine: [\n            \"videoconference\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/vish.svg\",\n        route: \"http://vishub.org\",\n        title: \"ViSH: Open source e-learning platform\",\n        description: \"ViSH is a social and collaborative platform focused on the creation and sharing of open educational resources. ViSH provides a collection of tools and services to facilitate the creation, distribution and use of high quality educational materials and to foster technology enhanced learning both in the classroom as well as in Virtual Learning Environments. \",\n        description_es: \"ViSH es una plataforma social y colaborativa centrada en la creacin y comparticin de recursos educativos abiertos. ViSH proporciona una coleccin de herramientas y servicios para facilitar la creacin, distribucin y uso de materiales educativos de alta calidad y fomentar el aprendizaje mejorado por tecnologa tanto en el aula como en Entornos Virtuales de Aprendizaje.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/yoda.png\",\n        route: \"http://yoda.dit.upm.es\",\n        title: \"YODA (Your Open DAta)\",\n        description: \"YODA (Your Open DAta) provides a service for European citizens that allows them to create personalised dashboards binding several sources of data (including the European Data Portal) through a single application. In addition, the Action deploys a data processing infrastructure that, on the basis of real time and machine learning processing, will provide additional processed results and predictions to the developed personalised service.\",\n        description_es: \"YODA (Your Open DAta) proporciona un servicio para los ciudadanos europeos que les permite crear paneles personalizados que vinculan varias fuentes de datos (incluido el Portal de Datos Europeo) a travs de una sola aplicacin. Adems, la Accin despliega una infraestructura de procesamiento de datos que, sobre la base de un procesamiento en tiempo real y de aprendizaje automtico, proporcionar resultados procesados adicionales y predicciones al servicio personalizado desarrollado.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/arportwin.png\",\n        route: \"https://www.eitdigital.eu/fileadmin/files/2020/factsheets/digital-tech/EIT-Digital-Factsheet-AR4portTwin.pdf\",\n        title: \"A/RporTWIN\",\n        description: \"A/RporTWIN is a new generation management platform focused on Airport Management and Airports operations. It acts a single-source of truth for different airport related operators. Some of its features are VR/AR and Mixed technologies compatibility, third party data integration and rich information representation. The data management core is based on FIWARE.\",\n        description_es: \"A/RporTWIN es una plataforma de gestin de nueva generacin centrada en la Gestin de Aeropuertos y las operaciones de los aeropuertos. Acta como una nica fuente de verdad para diferentes operadores relacionados con el aeropuerto. Algunas de sus caractersticas son la compatibilidad con tecnologas VR/AR y Mixtas, la integracin de datos de terceros y la representacin de informacin rica. El ncleo de gestin de datos se basa en FIWARE.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/smarterp.png\",\n        route: \"https://smarterp.kunveno.digital/\",\n        title: \"SmarTerp\",\n        description: \"SmarTerp addresses inefficiencies in interpreting by developing AI-powered tools embedded in a Remote Simultaneous Interpreting system that automates the human human task of extracting information in real-time to prevent the mistakes and loss of quality derived from the adoption of remote technologies. The Remote Simultaneous Interpreting system is based on Licode.\",\n        description_es: \"SmarTerp aborda las ineficiencias en la interpretacin mediante el desarrollo de herramientas impulsadas por IA integradas en un sistema de interpretacin simultnea remota que automatiza la tarea humana de extraer informacin en tiempo real para prevenir los errores y la prdida de calidad derivados de la adopcin de tecnologas remotas. El sistema de interpretacin simultnea remota se basa en Licode.\",\n        researchLine: [\n            \"videoconference\",\n            \"e-learning\"\n        ],\n        projectType: \"private-project\"\n    },\n    {\n        logo: \"/assets/img/logos/boost.png\",\n        route: \"https://boost40.eu/\",\n        title: \"Boost 4.0\",\n        description: \"Boost 4.0 is the biggest European initiative in Big Data for Industry 4.0. With a 20M budget and leveraging 100M of private investment, Boost 4.0 will lead the construction of the European Industrial Data Space to improve the competitiveness of Industry 4.0 and will guide the European manufacturing industry in the introduction of Big Data in the factory, providing the industrial sector with the necessary tools to obtain the maximum benefit of Big Data.\",\n        description_es: \"Boost 4.0 es la mayor iniciativa europea en Big Data para la Industria 4.0. Con un presupuesto de 20M y aprovechando 100M de inversin privada, Boost 4.0 liderar la construccin del Espacio Europeo de Datos Industriales para mejorar la competitividad de la Industria 4.0 y guiar a la industria manufacturera europea en la introduccin de Big Data en la fbrica, proporcionando al sector industrial las herramientas necesarias para obtener el mximo beneficio del Big Data.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/sgame.png\",\n        route: \"https://sgame.etsisi.upm.es\",\n        title: \"SGAME\",\n        description: \"SGAME is a free web platform aimed at the educational community that allows to easily create web educational games by integrating educational resources into existing games.\",\n        description_es: \"SGAME es una plataforma web gratuita dirigida a la comunidad educativa que permite crear fcilmente juegos educativos web integrando recursos educativos en juegos existentes.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/educaInternet.png\",\n        route: \"http://educainternet.es/\",\n        title: \"EducaInternet\",\n        description: \"EducaInternet is a collaborative platform whose main objective is to facilitate the teaching community to learn and teach the safe and responsible use of technologies. The EducaInternet platform offers an authoring tool to create content, a contest for the best resources created and training courses. EducaInternet has more than 15,000 resources on the Secure Use of ICT and more than 4000 registered users to date.\",\n        description_es: \"EducaInternet es una plataforma colaborativa cuyo principal objetivo es facilitar a la comunidad docente aprender y ensear el uso seguro y responsable de las tecnologas. La plataforma EducaInternet ofrece una herramienta de autor para crear contenido, un concurso para los mejores recursos creados y cursos de formacin. EducaInternet cuenta con ms de 15.000 recursos sobre el Uso Seguro de las TIC y ms de 4000 usuarios registrados hasta la fecha.\",\n        researchLine: [\n            \"e-learning\",\n            \"data\"\n        ],\n        projectType: \"private-project\"\n    },\n    {\n        logo: \"/assets/img/logos/eid-fiware.svg\",\n        route: \"https://ec.europa.eu/inea/en/connecting-europe-facility/cef-telecom\",\n        title: \"CEF eID-FIWARE\",\n        description: \"This project integrates the eID DSI in the FIWARE platform, which provides a set of APIs (Application Programming Interfaces) for the development of Smart Applications in sectors oriented to the Future Internet. It will develop FIWARE Identity Manager  eIDAS authentication gateway joining both eIDAS and FIWARE Identity Manager. After the integration of eID DSI with FIWARE Identity Management and Access Control General Enabler, it is possible to access FIWARE ecosystem services with eIDAS eIDs of EU citizens.\",\n        description_es: \"Este proyecto integra el DSI eID en la plataforma FIWARE, que proporciona un conjunto de APIs (Interfaces de Programacin de Aplicaciones) para el desarrollo de Aplicaciones Inteligentes en sectores orientados a Internet del Futuro. Se desarrollar el Gestor de Identidad FIWARE - pasarela de autenticacin eIDAS uniendo tanto eIDAS como el Gestor de Identidad FIWARE. Tras la integracin de eID DSI con la Gestin de Identidad FIWARE y el General Enabler de Control de Acceso, es posible acceder a los servicios del ecosistema FIWARE con los eIDs eIDAS de los ciudadanos de la UE.\",\n        researchLine: [\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/eid4u.png\",\n        route: \"https://ec.europa.eu/inea/en/connecting-europe-facility/cef-telecom\",\n        title: \"eID4U\",\n        description: \"This project integrates the eIDAS-compliant national eIDs in services offered by the European academic world. We created a virtual student card based on the standard eIDAS attributes for physical persons, extended with those new attributes required for the academic environment. We integrated the solution in several services of the universities taking part in the consortium (UPM, POLITO, ULISBOA, JSI and University of Graz).\",\n        description_es: \"Este proyecto integra los eIDs nacionales compatibles con eIDAS en los servicios ofrecidos por el mundo acadmico europeo. Creamos una tarjeta de estudiante virtual basada en los atributos estndar de eIDAS para personas fsicas, ampliados con aquellos nuevos atributos requeridos para el entorno acadmico. Integramos la solucin en varios servicios de las universidades que forman parte del consorcio (UPM, POLITO, ULISBOA, JSI y Universidad de Graz).\",\n        researchLine: [\n            \"e-learning\",\n            \"data\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/mooc.svg\",\n        route: \"https://cyberaula.github.io/courses\",\n        title: \"MOOCs\",\n        description: \"This project consists of a set of Massive Open Online Courses developed by UPM in cooperation with the Telefnica Chair at UPM. These MOOCs are prepared primarily by teachers, published in open and universally accessible via the Internet. Allow, among other things, create learning communities, access knowledge and specialization to millions of people, asynchronously and free of charge, with predictive and adaptive learning models. \\nThe MOOCs focus on Software Engineering and in Fullstack Web programming using JavaScript.\",\n        description_es: \"Este proyecto consiste en un conjunto de Cursos Masivos Abiertos en Lnea desarrollados por la UPM en cooperacin con la Ctedra Telefnica en la UPM. Estos MOOCs estn preparados principalmente por profesores, publicados en abierto y accesibles de forma universal a travs de Internet. Permiten, entre otras cosas, crear comunidades de aprendizaje, acceder al conocimiento y especializacin a millones de personas, de forma asncrona y gratuita, con modelos de aprendizaje predictivos y adaptativos. \\nLos MOOCs se centran en Ingeniera del Software y en programacin Web Fullstack utilizando JavaScript.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/mooc.svg\",\n        route: \"https://innovacioneducativa.upm.es/saga/plato-saga\",\n        title: \"SAGA\",\n        description: \"'SAGA' (Advanced recording automated system) allows teachers to record high quality videos for MOOCs, video tutorials, flipped classroom, etc. The teacher can record videos autonomously with no support personnel, once the audiovisual staff configures a custom preset for him. The video at the bottom shows how this process is done. Recorded videos require no post-production and are ready to be uploaded to YouTube, Moodle, etc.\",\n        description_es: \"'SAGA' (Sistema automatizado de grabacin avanzada) permite a los profesores grabar vdeos de alta calidad para MOOCs, video tutoriales, aula invertida, etc. El profesor puede grabar vdeos de forma autnoma sin personal de apoyo, una vez que el personal audiovisual le configura un preset personalizado. El vdeo de abajo muestra cmo se hace este proceso. Los vdeos grabados no requieren postproduccin y estn listos para ser subidos a YouTube, Moodle, etc.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/isabel.svg\",\n        route: \"https://ging.github.com/isabel\",\n        route2: \"https://es.wikipedia.org/wiki/Usuario:SonsolesLP/Isabel\",\n        title: \"ISABEL\",\n        description: \" Isabel supported collaborative video-conferencing with a floor control coordinating the proper configuration of audio, video, slides, pointers and other multimedia components. ISABEL workstations were connected with TCP/IP over the ATM and satellite broadband infrastructures.\",\n        description_es: \"Isabel permita videoconferencias colaborativas con un control de piso que coordinaba la configuracin adecuada de audio, video, diapositivas, punteros y otros componentes multimedia. Las estaciones de trabajo de ISABEL estaban conectadas con TCP/IP sobre las infraestructuras de banda ancha ATM y satelital.\",\n        researchLine: [\n            \"videoconference\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/global.png\",\n        route: \"https://cordis.europa.eu/project/rcn/86659/factsheet/en\",\n        title: \"GLOBAL\",\n        description: \"GLOBAL (Global Linkage Over BroadbAnd Links) project studies, conferences and coordination actions supporting policy development, including international cooperation, for e-Infrastructures \",\n        description_es: \"El proyecto GLOBAL (Global Linkage Over BroadbAnd Links) estudia, conferencias y acciones de coordinacin que apoyan el desarrollo de polticas, incluida la cooperacin internacional, para las e-Infraestructuras.\",\n        researchLine: [\n            \"videoconference\",\n            \"e-learning\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/global-excursion.svg\",\n        route: \"https://cordis.europa.eu/project/rcn/100728/factsheet/es\",\n        title: \"Global-excursion\",\n        description: \"GLOBAL-excursion set out to enhance science teaching in European schools. This ambitious goal\\nwas reached by providing an innovative portal that offers teachers and their pupils as well as\\nscientists and policy makers a package of activities, materials, and tools for enabling the integration\\nof scientific content and infrastructures into school curricula.\",\n        description_es: \"GLOBAL-excursion se propuso mejorar la enseanza de la ciencia en las escuelas europeas. Este ambicioso objetivo se logr proporcionando un portal innovador que ofrece a los profesores y sus alumnos, as como a los cientficos y responsables polticos, un paquete de actividades, materiales y herramientas para permitir la integracin de contenido cientfico e infraestructuras en los planes de estudio escolares.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"european-project\"\n    },\n    {\n        logo: \"/assets/img/logos/vishEditor.svg\",\n        route: \"https://github.com/ging/vish_editor\",\n        title: \"ViSH Editor\",\n        description: \"ViSH Editor is an open source e-learning authoring tool that allows to create web presentations in a simple and friendly way.\",\n        description_es: \"ViSH Editor es una herramienta de autora de e-learning de cdigo abierto que permite crear presentaciones web de forma sencilla y amigable.\",\n        researchLine: [\n            \"e-learning\"\n        ],\n        projectType: \"national-project\"\n    },\n    {\n        logo: \"/assets/img/logos/arqueopterix.svg\",\n        route: \"\",\n        title: \"Arqueopterix\",\n        description: \"Arqueopterix is a project aimed at improving the user experience in interactive video applications on fixed and mobile networks, with special applicability in the entertainment industry (virtualized games, online multiplayer games) but also in applications of any type virtualized, where a smooth user experience is expected.\",\n        description_es: \"Arqueopterix es un proyecto destinado a mejorar la experiencia del usuario en aplicaciones de video interactivas en redes fijas y mviles, con una aplicabilidad especial en la industria del entretenimiento (juegos virtualizados, juegos multijugador en lnea) pero tambin en aplicaciones de cualquier tipo virtualizadas, donde se espera una experiencia de usuario fluida.\",\n        researchLine: [\n            \"videoconference\"\n        ],\n        projectType: \"national-project\"\n    }\n]; //   id: \"1\",\n //   date: \"2023\",\n //   route: \"https://innovacioneducativa.upm.es/mooc/informacion-mooc?idmooc=356\",\n //   title: \"Utilizacin de escape rooms y videojuegos educativos en la Educacin Universitaria\",\n //   center: \"E.T.S DE ING. DE SISTEMAS INFORMTICOS\",\n //   description: \"\",\n //   tags: \"Aprendizaje Activo,Aprendizaje Autnomo,Investigacin educativa,Aula Invertida,Gamificacin\",\n //   category: \"erg\",\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/projects.js\n");

